def check(s,a,z,b):
    c =ord(s[z])%96
    if z==0:
        return c
    if a==s[z-1]:
        c+=b
    return c
def weightedUniformStrings(s, queries):
    b=[-1]
    for i in range(0,len(s)):
        c=0
        a=check(s,s[i],i,b[-1])
        b.append(a)
    b.remove(-1)
    b.sort()
    a=[]
    for i in range(0,len(queries)):
        index = -1
        first = 0
        last = len(b)
        if queries[i]>b[-1] or queries[i]<b[0]:
            a.append("No")
            continue
        while first<=last and index==-1:
            mid = (first+last)//2
            print(queries[i],':',b[mid],':',mid)
            if queries[i]==b[mid]:
                index=mid
